import React, { useState, useContext, useRef } from 'react';

import { Container, PageTitle, Input } from './styles';
import { InputGroup, InputText, LabelInput, InputTextBox, Button } from '../../../styles/forms';

function Chat() {

    return (
        <Container>
            <PageTitle>Chat websocket</PageTitle>


            <InputGroup>
                <LabelInput htmlFor="username">Username</LabelInput>

                <InputText
                    id="username"
                    required />
            </InputGroup>

        </Container>
    );
}

export default Chat;
